column8:
DC12V電源で作動するバケツタイプの高圧洗浄機<br>近くに100V電源や水道がなくてもＯＫ！<br>洗車はもちろん、海水浴後のシャワーやキャンプでも大活躍！<br><br>高圧スプレーからワックス洗車までこなせます。<br><br><br>【特徴】<br>バケツは大容量22リットル<br>コンプレッサー内蔵で水と車があれば、どこでも洗車可能。<br>シャンプーボトル付きなのでシャンプー洗車ができる<br>スプレーガンは便利なシャワー水流固定機能付き<br>ブラシガンは便利な連続噴射固定レバー付き<br>DCコードは衝撃に強い硬質樹脂製<br>バケツ蓋の耐荷重90kg<br>50℃以下のお湯または水で使用可能<br><br><br>【仕様】<br>定格電圧：DC12V<br>消費電流：2.5A<br>バケツ容量：22L<br>電源コード：3m<br>ホース長：6m<br>コンプレッサー放水水量：0.8～1Ｌ/分<br>コンプレッサー放水水圧：8～10K(約0.882mpa)<br>製品サイズ：約H300×W380×D340mm<br>重量：約4.5kg<br><br>メーカー：Remix/リミックス<br>品番：HB-22L<style type="text/css">
